import React,{useState,useEffect} from 'react'


const Display = () => {
    
    const [display , setDisplay]=useState([]);
    const getData=async()=>{
        try {
            const data= await fetch("/userinput");
            console.log(data.body);
            setDisplay(data.body)
        } catch (error) {
            
        }
    }
    
    useEffect(() => {
        getData();
    }, [])
    return (
        <div>
            <h1>Display</h1>
            {display.map(item=>{
                return <p>{item.data.body}</p>
            })}
        </div>
    )
}

export default Display
